window.bookSummaryJSON = "<p><b><i>Rook and Ronin Omnibus contains the books </i></b><b>Tragic</b><b><i>, </i></b><b>Manic</b><b><i>, and </i></b><b>Panic </b><b><i>and features a runaway girl who falls into a million-dollar dream of cherry trees and rooftop swings. A bad boy with a sketchy history of breaking pretty girls. And a job called Tragic that might ruin everything.</i></b></p> <p><b><i>Tragic</i></b></p> <p><b>She’s on the run from a horrible past.</b></p> <p><b>He’s got an offer of a lifetime.</b></p> <p><b>Ronin</b></p> <p>Rook Walsh appeared out of nowhere like a dark angel sent to steal my soul. And I could just tell that she was broken, and beaten, and scared.</p> <p>So I made her an offer of a lifetime. She needed a job and I needed a certain \"type\" of girl for a modeling contract worth millions of dollars called Tragic.</p> <p>I was <i>warned</i> to keep my hands to myself.</p> <p>I was <i>warned</i> not to get involved.</p> <p>I was <i>warned</i> not to ruin her.</p> <p>(The way I ruined the last one.)</p> <p>But I don’t <i>take</i> orders - I <i>give</i> them.</p> <p><b>Rook</b></p> <p>Ronin Flynn appeared out of nowhere like a bright light in my heavy darkness. And when he offered me a job, and money, and a fantasy rooftop apartment, I wanted to believe that he was good, and fair, and honest.</p> <p>But I’d been tricked by a pretty face before.</p> <p>I’d fallen for the knight once - and lost everything.</p> <p>This was my chance to start over.</p> <p>This was my chance to escape and be free.</p> <p>And this was my chance to do it all by myself.</p> <p>I don’t need a knight.</p> <p>I don’t want to be saved.</p> <p>But sometimes you find yourself trapped inside the fairy tale, and no matter how hard you try, nothing you do can stop the train wreck coming.</p>"; 
